val random = new LinearCongruentGenerator(A0 = new DateTime().getMillis / 1000)

def average(arr: Array[Double]): Double = arr.sum / arr.length

def mean(arr: Array[Double]): Double = average(arr)

def variance(arr: Array[Double]): Double = {
    val sEV = average(arr)
    average(arr.map(i => scala.math.pow(i - sEV, 2)))
}

def groupToBins(sample: Array[Double], M: Int, a: Double, b: Double, interval: Double): Map[Int,Double] = {
    sample.groupBy(i => ((i - a) / interval).toInt).filter(_._1 < M).map(kv => (kv._1, kv._2.length / sample.length.toDouble))
}

def groupToBinsDiscret(sample: Array[Double], M: Int, a: Double, b: Double, interval: Double): Map[Int,Double] = {
    sample.groupBy(i => ((i - a) / interval).toInt).map(kv => (kv._1, kv._2.length / sample.length.toDouble))
}

def qrt(expr: Double) = scalaPow(expr, 0.5)

def near(value: Double, etalon: Double, e: Double = 0.01): Boolean = scalaAbs(value - etalon) < e

def nearw(etalon: Double, e: Double = 0.01) = (value: Double) => near(value, etalon, e)

def xByY(sample: Array[(Double, Double)], predicate: (Double) => Boolean): Array[Double] = {
    sample.filter(i => predicate(i._2)).map(_._1)
}

def yByX(sample: Array[(Double, Double)], predicate: Double => Boolean): Array[Double] = {
    sample.filter(i => predicate(i._1)).map(_._2)
}

def rnd(x: Double, precision: Int) = scala.math.rint(x * scalaPow(10, precision)) / scalaPow(10, precision)

def createCumSum(arr: Array[Int]) = {
    val elementsSum = arr.sum
    var accum = 0.0
    val cumSum = ArrayBuffer.empty[Double]
    arr.foreach(i => {
        accum += i.toDouble / elementsSum
        cumSum += accum
    })

    cumSum.toArray
}

def mapToProbabilities(arr: Array[Int]) = {
    val sum = arr.sum
    arr.map(i => i.toDouble / sum)
}

def generateSample(arr: Array[Double], n: Int): Array[Double] = {
    val buf = new ArrayBuffer[Double]()
    (0 until n).foreach(i => buf += arr((n * random.next).toInt))
    buf.toArray
}

def calcIntervalStatistic(arr: Array[Double], m: Int, statistic: Array[Double] => Double): (Double, Double) = {
    val point_stat = statistic(arr)

    val samples = (0 to m).map(i => generateSample(arr, arr.length))
    val statistics = samples.map(statistic).toArray
    val S2 = variance(statistics)
    val s = scala.math.pow(S2, 0.5)
    (point_stat - 3 * s, point_stat + 3 * s)
}

import breeze.stats.distributions.ChiSquared

def calcXi2(sample: Array[Double], 
            M: Int, 
            F: Double => Double, 
            S: Int, 
            beta: Double): (Double, Double, Boolean) = {

    val N = sample.length

    // Setting up interval boundaties and interval value
    val (a, b) = (sample.min, sample.max)
    val interval = (b - a) / M

    val grouped = groupToBins(sample, M, a, b, interval)

    // Calculating theoretical propability value
    def p(i: Int) = F(a + interval * (i + 1)) - F(a + interval * i)

    val chi2 = N * grouped.map(kv => scalaPow(kv._2 - p(kv._1), 2) / p(kv._1)).sum

    // val chi2 = N * groupedDf.agg(sum(pow('pi_ - pi('int_id), 2) / pi('int_id))).first.getDouble(0)
    val boundaryValue = ChiSquared(M - S - 1).inverseCdf(1 - beta)

    (chi2, boundaryValue, chi2 < boundaryValue)
}

def dcalcXi2(sample: Array[Double], 
            variationProbabilities: Array[Double],
            variationValues: Array[Double],
            S: Int, 
            beta: Double): (Double, Double, Boolean) = {

    val N = sample.length

    val grouped = sample.groupBy(i => i).map(kv => (kv._1, kv._2.length.toDouble / N))

    // Calculating theoretical propability value
    def p(x: Double) = variationProbabilities(variationValues.indexWhere(i => scalaAbs(i - x) < 0.01))

    val chi2 = N * grouped.map(kv => scalaPow(kv._2 - p(kv._1), 2) / p(kv._1)).sum

    // val chi2 = N * groupedDf.agg(sum(pow('pi_ - pi('int_id), 2) / pi('int_id))).first.getDouble(0)
    val boundaryValue = ChiSquared(grouped.size - S - 1).inverseCdf(1 - beta)

    (chi2, boundaryValue, chi2 < boundaryValue)
}

def f(x: Double, y: Double) = (3 / (8 * Pi)) * (2 - qrt(x * x + y * y))

// Because of we have simmetric marginal probability functions for x and y, will use one
def fmargin(t: Double) = {
    // Handling divison by zero by finding limit at t -> 0
    if(scalaAbs(t) < 0.0000001) 1.5 / Pi
    else (3 / (16 * Pi)) * (4 * qrt(4 - t * t) - t * t * scalaLog((2 + qrt(4 - t * t)) / (2 - qrt(4 - t * t))))
}

def cpy(x: Double) = (y: Double) => f(x, y) / fmargin(x)

def cpx(y: Double) = (x: Double) => f(x, y) / fmargin(y)

def Fx(y: Double) = (x: Double) => {
    // Handling divison by zero by finding limit at t -> 0
    if(scalaAbs(y) < 0.0000001) (3 / (16 * Pi * fmargin(y))) * (4 * x - x * qrt(x * x  + y * y) + 2 * qrt(4 - y * y))
    else (3 / (16 * Pi * fmargin(y))) * (4 * x - x * qrt(x * x + y * y) + 2 * qrt(4 - y * y) - y * y * scalaLog((qrt(x * x + y * y) + x) / (2 - qrt(4 - y * y))))
}

def Fy(x: Double) = (y: Double) => {
    if(scalaAbs(y) < 0.0000001) (3 / (16 * Pi * fmargin(x))) * (4 * y - y * qrt(x * x  + y * y) + 2 * qrt(4 - x * x))
    else (3 / (16 * Pi * fmargin(x))) * (4 * y - y * qrt(x * x  + y * y) + 2 * qrt(4 - x * x) - x * x * scalaLog((qrt(x * x + y * y) + y) / (2 - qrt(4 - x * x))))
}

@tailrec
final def getSampleFromAtoB(from: Double, to: Double, probabilityFunction: Double => Double, r: LinearCongruentGenerator): Double = {
    val r1 = r.next
    val r2 = r.next
    val x = from + (to - from) * r1
    val pfMaxValue = probabilityFunction(0) // using some cheats for now :)
    if (r2 * pfMaxValue < probabilityFunction(x)) x
    else getSampleFromAtoB(from, to, probabilityFunction, r)
}

@tailrec
final def GibbsSampling(xPrev: Double, 
                        yPrev: Double, 
                        from: Double, 
                        to: Double, 
                        cpx: Double => Double => Double, 
                        cpy: Double => Double => Double, 
                        arr: ArrayBuffer[(Double, Double)],
                        r: LinearCongruentGenerator,
                        i: Int): Array[(Double, Double)] = {
    if(i == 0) arr.toArray
    else {
        val x = getSampleFromAtoB(from, to, cpx(yPrev), r)
        val y = getSampleFromAtoB(from, to, cpy(x), r)
        GibbsSampling(x, y, from, to, cpx, cpy, arr += Tuple2(x, y), r, i - 1)
    }
}

